import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const Navigation = () => {
  const history = useHistory();

  const handleLogout = () => {
    // Clear token from localStorage (simulate logout)
    localStorage.removeItem('token');

    // Redirect to the login page or any other desired route after logout
    history.push('/login'); // Replace '/login' with your desired logout redirection route
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <Link className="navbar-brand" to="/">ProSport</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link" to="/o-nama">O nama</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/ishrana">Ishrana</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/trening">Trening</Link>
            </li>
          </ul>
        </div>
        <button className="btn btn-outline-danger" onClick={handleLogout}>Logout</button>
      </div>
    </nav>
  );
};

export default Navigation;
